import React, {Component} from 'react';
import {Link} from 'react-router.dom';

class Nav extends Component {
  render() {
    return (
      <nav>
        <h3>Logo</h3>
        <ul className="nav-links">
          <Link to="/quiz">
            <li>Quiz</li>
          </Link>
        </ul>
      </nav>

    );
  }

}

export default Nav;
